import json
from src.entidades.dominio import Dominio
from src.enums.tipo_de_memoria_enum import TipoDeMemoriaEnum
from src.memoria.repo.memoria_json import MemoriaJSON


class Test_MemoriaJSON:
    def test_memoria_json(self):
        arquivo = TipoDeMemoriaEnum.MEMORIA_DE_DADOS
        memoria = MemoriaJSON(arquivo=arquivo)
        assert memoria._diretorio == "src/memoria/armazenamento"
        assert type(memoria.memoria) == dict
        assert memoria.nome_do_arquivo == arquivo.value
        with open(f"{memoria._diretorio}/{arquivo.value}.json") as f:
            assert memoria.memoria == json.load(f)
            f.close()
            
        arquivo = TipoDeMemoriaEnum.MEMORIA_DE_PROGRAMA
        memoria = MemoriaJSON(arquivo=arquivo)
        assert memoria._diretorio == "src/memoria/armazenamento"
        assert type(memoria.memoria) == dict
        with open(f"{memoria._diretorio}/{arquivo.value}.json") as f:
            assert memoria.memoria == json.load(f)
            f.close()
    
    def test_memoria_ler_e_altera_celula(self):
        arquivo = TipoDeMemoriaEnum.MEMORIA_DE_DADOS
        memoria = MemoriaJSON(arquivo=arquivo)
        assert memoria.ler_celula("0x000") == "0000" 
        
        memoria.altera_celula("0x000", "ABCD")
        assert memoria.ler_celula("0x000") == "ABCD"
    
    def test_memoria_altera_todas_as_celulas(self):
        arquivo = TipoDeMemoriaEnum.MEMORIA_DE_DADOS
        memoria = MemoriaJSON(arquivo=arquivo)
        assert memoria.memoria == memoria.ler_todas_as_celulas()
        
    def test_memoria_altera_todas_as_celulas(self):
        arquivo = TipoDeMemoriaEnum.MEMORIA_DE_DADOS
        memoria = MemoriaJSON(arquivo=arquivo)
        nova_memoria = {
            "0x" + Dominio.HEXADECIMAL[i] + Dominio.HEXADECIMAL[j] + Dominio.HEXADECIMAL[k]: "ACDC"
            for i in range(0, 16)
            for j in range(0, 16)
            for k in range(0, 16)
        }
        memoria.altera_todas_as_celulas(nova_memoria)
        
        assert len(memoria.memoria) == 16**3
        assert memoria.memoria["0x000"] == "ACDC"
        assert memoria.memoria["0xFFF"] == "ACDC"
        assert memoria.memoria["0xA2D"] == "ACDC"
        assert memoria.memoria["0x1C3"] == "ACDC"

            
    def test_limpa_memoria(self):
        arquivo = TipoDeMemoriaEnum.MEMORIA_DE_DADOS
        memoria = MemoriaJSON(arquivo=arquivo)
        nova_memoria = {
            "0x" + Dominio.HEXADECIMAL[i] + Dominio.HEXADECIMAL[j] + Dominio.HEXADECIMAL[k]: "ACDC"
            for i in range(0, 16)
            for j in range(0, 16)
            for k in range(0, 16)
        }
        memoria.altera_todas_as_celulas(nova_memoria)
        memoria.limpa_memoria()
        expected = {
            "0x" + Dominio.HEXADECIMAL[i] + Dominio.HEXADECIMAL[j] + Dominio.HEXADECIMAL[k]: "0000"
            for i in range(0, 16)
            for j in range(0, 16)
            for k in range(0, 16)
        }
        assert expected == memoria.memoria
        
